import axios from 'axios'
import React, {useEffect, useState} from 'react'
import { useParams } from 'react-router-dom'

import cssLogin from '../Css/LoginEffettuato.css'

function PersonalPage() {

  const [utente,setUtente] = useState("");

  let {id} = useParams();

  useEffect(() => {

    axios.get(`http://localhost:3002/auth/ottieniUtenti/${id}`).then((response)=>{

      console.log(utente);
      setUtente(response.data.username); //li memorizza dentro lo stato

    });

  }, [])



  return (
  <div className='ProfilePageContainer flex-container align-center justify-content'>

    <div className='ProfilePageItems'>

      {utente}


    </div>
  </div>

  )
}

export default PersonalPage
